import axios from "axios";
import { request } from '../utils/request';

export const getUserByUrl = async url => {
    const res = await request.get(url);
    return res.data[0];
}

export const getUserById = async id => {
    const res = await request.get('/user', {
        params:{ id }
    });
    return res.data[0];
}
